  hungerLevel: {
    type: Number,
    default: 0,
  },
  healthLevel: {
    type: Number,
    default: 0,
  },
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: "User",
    required: true,
  },
  createdAt: {
    type: Date,
    default: Date.now,
  },
  lifespan: {
    type: Number,
    default: 0,
  },
});

const Pet = mongoose.model("Pet", petSchema);

module.exports = Pet;

